(10, 1, 'ACS-FW', 'Anti Collision Strip 1m Polyurethane Black/Yellow - FW', 'anti-collision-strip-1m-polyurethane-blackyellow-fw', '', '**Description**\r\n\r\nThe Anti-collision Strips are designed to protect people/machine/building from impact with hard surfaces. The new polyurethane foam has a bright yellow and black striped finish that is abrasion resistant and will work indoors or outdoors. Each piece comes with 3M self-adhesive tape but can also be attached with silicone adhesive.\r\n\r\n**Specification**\r\n\r\nCode: ACS-FW\r\n\r\nMaterial: New polyurethane\r\n\r\nAdhesive: 3M self-adhesive\r\n\r\nColor: Yellow/Black\r\n\r\nLength: 1000mm\r\n\r\nWidth: 60mm\r\n\r\nThickness: 21mm', '<p><strong>Description</strong></p>\n<p>The Anti-collision Strips are designed to protect people/machine/building from impact with hard surfaces. The new polyurethane foam has a bright yellow and black striped finish that is abrasion resistant and will work indoors or outdoors. Each piece comes with 3M self-adhesive tape but can also be attached with silicone adhesive.</p>\n<p><strong>Specification</strong></p>\n<p>Code: ACS-FW</p>\n<p>Material: New polyurethane</p>\n<p>Adhesive: 3M self-adhesive</p>\n<p>Color: Yellow/Black</p>\n<p>Length: 1000mm</p>\n<p>Width: 60mm</p>\n<p>Thickness: 21mm</p>', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1801, '2019-11-25 09:05:54', 1, '2019-11-19 22:48:38', '2019-11-27 22:47:35', NULL),
(11, 1, 'ACS-RC', 'Anti Collision Strip 1m Polyurethane Black/Yellow - RC', 'anti-collision-strip-1m-polyurethane-blackyellow-v-profile', '', '**Description**\r\n\r\nThe Anti-collision Straps are designed to protect people/machine/building from impact with hard corners, edges. The new polyurethane foam has a bright yellow and black striped finish that is abrasion resistant and will work indoors or outdoors. Each piece comes with 3M self-adhesive tape but can also be attached with silicone adhesive.\r\n\r\n**Specification**\r\n\r\nCode: ACS-RC\r\n\r\nMaterial: New polyurethane\r\n\r\nAdhesive: 3M self-adhesive\r\n\r\nColor: Yellow/Black\r\n\r\nLength: 1000mm\r\n\r\nDiameter: 40mm', '<p><strong>Description</strong></p>\n<p>The Anti-collision Straps are designed to protect people/machine/building from impact with hard corners, edges. The new polyurethane foam has a bright yellow and black striped finish that is abrasion resistant and will work indoors or outdoors. Each piece comes with 3M self-adhesive tape but can also be attached with silicone adhesive.</p>\n<p><strong>Specification</strong></p>\n<p>Code: ACS-RC</p>\n<p>Material: New polyurethane</p>\n<p>Adhesive: 3M self-adhesive</p>\n<p>Color: Yellow/Black</p>\n<p>Length: 1000mm</p>\n<p>Diameter: 40mm</p>', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1802, '2019-11-25 09:05:54', 1, '2019-11-19 22:53:14', '2019-11-27 22:48:10', NULL),
