(15, 1, 'AT50183', 'Anti-Slip Tape', 'anti-slip-tape', 'W 5cm x L 18.3m', '**PRODUCT DESCRIPTION**\r\n\r\nReduce accidents due to slipping. Apply to any clean dry surface, eg. stair treads, ramps or hazardous floors. \r\n\r\nDurable self adhesive backed grit surface.\r\n\r\n**Specifications**\r\n\r\nCode: AT50183\r\n\r\nMaterial: Adhesive PVC film + 80# carbordundum\r\n\r\nWidth: 50mm as standard, other widths can be customized \r\n\r\nLength: 18.3m as standard, other lengths can be customized\r\n\r\nColor: Yellow, Black, Red, White, Green, Blue, Greey, Brown, Yellow/Black, Red/White, etc\r\n\r\nGrade: Standard #80', '<p><strong>PRODUCT DESCRIPTION</strong></p>\n<p>Reduce accidents due to slipping. Apply to any clean dry surface, eg. stair treads, ramps or hazardous floors. </p>\n<p>Durable self adhesive backed grit surface.</p>\n<p><strong>Specifications</strong></p>\n<p>Code: AT50183</p>\n<p>Material: Adhesive PVC film + 80# carbordundum</p>\n<p>Width: 50mm as standard, other widths can be customized </p>\n<p>Length: 18.3m as standard, other lengths can be customized</p>\n<p>Color: Yellow, Black, Red, White, Green, Blue, Greey, Brown, Yellow/Black, Red/White, etc</p>\n<p>Grade: Standard #80</p>', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2001, '2019-11-25 09:05:54', 1, '2019-11-19 23:41:40', '2019-11-20 20:26:03', NULL),
(16, 1, 'FRP-SN7010', 'FRP Stair Nosing 70 x 10mm -  Yellow', 'FRP-stair-nosing-70-x-10mm-yellow', '', '**PRODUCT DESCRIPTION**\r\n\r\nIndustrial fibreglass reinforced plastic stair nosing is hard wearing and suitable for high traffic access stairs and platforms such as marine, mining and factory environments. Due to its extremely hard grit this FRP stair nosing provides an aggressive non slip surface even in wet, oily, greasy or dusty environments. \r\n\r\n**Specifications**\r\n\r\nCode: FRP-SN7010\r\n\r\nMaterial:	Fibreglass Reinforced Plastic \r\n\r\nWidth:	70mm\r\n\r\nNose/Face:	10mm\r\n\r\nColor: Yellow, Black\r\n\r\nGrade: Heavy Duty, Medium, Fine three types for chosing', '<p><strong>PRODUCT DESCRIPTION</strong></p>\n<p>Industrial fibreglass reinforced plastic stair nosing is hard wearing and suitable for high traffic access stairs and platforms such as marine, mining and factory environments. Due to its extremely hard grit this FRP stair nosing provides an aggressive non slip surface even in wet, oily, greasy or dusty environments. </p>\n<p><strong>Specifications</strong></p>\n<p>Code: FRP-SN7010</p>\n<p>Material:   Fibreglass Reinforced Plastic </p>\n<p>Width:  70mm</p>\n<p>Nose/Face:  10mm</p>\n<p>Color: Yellow, Black</p>\n<p>Grade: Heavy Duty, Medium, Fine three types for chosing</p>', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2101, '2019-11-25 09:05:54', 1, '2019-11-20 02:04:00', '2019-11-20 21:26:56', NULL),
