(31, 1, 'ASN-7510B', 'Aluminum Stair Nosing With FRP Insert 75 x 10mm - Black', 'aluminum-stair-nosing-frp-insert-75-x-10mm-black', '', '**Description**\r\n\r\nThe Aluminum Stair Nosing has a 10mm face with a Black carborundum(FRP) tape insert and is recommended for general indoor & outdoor environments with low to medium traffic areas. This stair nosing can be installed with glue or fixed in place using screws onto a variety of substrates including Timber, Concrete, Bitumen, Tiles, Vinyl, Rubber and Carpet. The Aluminum Stair nosing exceeds the requirements of AS4586:2013 the Australian/New Zealand Standards for anti-slip regulations. The Super Anti Slip 10mm face (SAS7510) is Australian compliant meeting the national building code standards - AS/NZS 1428.1.\r\n\r\n**Specification**\r\n\r\nCode: ASN-7510B\r\n\r\nWidth: 75mm\r\n\r\nFace: 10mm\r\n\r\nMaterial: Aluminium w/ Carborundum (FRP) Insert\r\n\r\nColors: Silver Aluminium w/ Black Insert\r\n\r\nGrade: Heavy Duty, Medium, Fine three types for chosing\r\n\r\nLocation: Indoor, outdoor', '<p><strong>Description</strong></p>\n<p>The Aluminum Stair Nosing has a 10mm face with a Black carborundum(FRP) tape insert and is recommended for general indoor &amp; outdoor environments with low to medium traffic areas. This stair nosing can be installed with glue or fixed in place using screws onto a variety of substrates including Timber, Concrete, Bitumen, Tiles, Vinyl, Rubber and Carpet. The Aluminum Stair nosing exceeds the requirements of AS4586:2013 the Australian/New Zealand Standards for anti-slip regulations. The Super Anti Slip 10mm face (SAS7510) is Australian compliant meeting the national building code standards - AS/NZS 1428.1.</p>\n<p><strong>Specification</strong></p>\n<p>Code: ASN-7510B</p>\n<p>Width: 75mm</p>\n<p>Face: 10mm</p>\n<p>Material: Aluminium w/ Carborundum (FRP) Insert</p>\n<p>Colors: Silver Aluminium w/ Black Insert</p>\n<p>Grade: Heavy Duty, Medium, Fine three types for chosing</p>\n<p>Location: Indoor, outdoor</p>', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2107, '2019-11-25 09:05:54', 1, '2019-11-24 18:48:09', '2019-11-27 22:52:54', NULL),
(32, 1, 'PU-TDS3005', 'PU Tactile Directional Strip 300x5mm', 'pu-tactile-indicator-hazard-studs-35x5mm', '', '**Description**\r\n\r\nJoined together and spaced like well-trained soldiers, these hazard warning tactiles (to Australian Standard) have bladed shafts to install with ease. Use a concrete saw to cut a groove and slide the tactiles blade base in for a tight fit. Pretty simple and you’re done. \r\n\r\n**Specification**\r\n\r\nCode: PU-TDS3005\r\n\r\nLength: 300mm\r\n\r\nHeight: 5mm\r\n\r\nDiameter:	35mm Per Stud\r\n\r\nQty:	6 x Studs Per Length\r\n\r\nMaterial: Polyurethane(PU)\r\n\r\nColour:	Black, Orange, White, and Yellow\r\n\r\nLocation: Indoor, outdoor', '<p><strong>Description</strong></p>\n<p>Joined together and spaced like well-trained soldiers, these hazard warning tactiles (to Australian Standard) have bladed shafts to install with ease. Use a concrete saw to cut a groove and slide the tactiles blade base in for a tight fit. Pretty simple and you’re done. </p>\n<p><strong>Specification</strong></p>\n<p>Code: PU-TDS3005</p>\n<p>Length: 300mm</p>\n<p>Height: 5mm</p>\n<p>Diameter:   35mm Per Stud</p>\n<p>Qty:    6 x Studs Per Length</p>\n<p>Material: Polyurethane(PU)</p>\n<p>Colour: Black, Orange, White, and Yellow</p>\n<p>Location: Indoor, outdoor</p>', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2301, '2019-11-25 09:05:54', 1, '2019-11-24 19:25:01', '2019-11-26 22:59:23', NULL),
